import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';

// Define components
function Home() {
  return <h2>Home Page</h2>;
}

function About() {
  return (
    <div>
      <h2>About Page</h2>
      <ul>
        <li><Link to="/about/team">Our Team</Link></li>
        <li><Link to="/about/history">Our History</Link></li>
      </ul>

      {/* Nested routes */}
      <Routes>
        <Route path="/about/team" render={() => <h3>Team Info</h3>} />
        <Route path="/about/history" render={() => <h3>History Info</h3>} />
      </Routes>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
